import React from 'react';
import Card from "./Card";
import sdata from "./Sdata";

function netflix(val){
    console.log(val);
    return(  

        <Card imgscr={val.imgscr}
        title={val.title}
        sname={val.sname}
        link={val.link}
        />

        
    );
}

function App(){
    return(
        <>
    <h1 className="heading">Below is the list of Series</h1>
        
   {sdata.map(netflix)}
    
    </>
    );
}
export default App;
